Prey items were found in 55 ( 82.1 %) of 67 nests of the first brood and in 5 ( 45.4 %) of 11 nests of the second brood, making a total of 60 ( 89.5 %) of 78 nests in the first breeding season. Mean prey per nest was 11.78 ± 16.92 and 3.8 ± 3.9 for the first and second brood respectively (positive nests) (
Table 3
). No prey item was found in the nests belonging to the second breeding season.

Mean prey per month decreases from November to December (
Table 4
). A decrease pattern of food availability along the season is usually found during the breeding season of swallows, reflecting a decrease of food abundance at the end of the season. A negative and significant correlation was found between the number of total prey items found in each nest and the date of nest recollection (N = 71 , R = - 0.43 , p = 0.0002 ). As the dipterans alone represent the 84.41 % of swallows’ diet, the decrease of the total prey items could not be reflecting an important factor on the main prey order. However, there was also a significant and negative correlation between the number of dipterans found in each nest and the date of nest recollection (N = 71 , R = - 0.46 , p = 0.0004 ). As a result, both the total number of prey items and the number of dipterans alone found in the nests decreased as the breeding season progressed (
Fig. 2
), concordantly with a decrease of food abundance ( Di Iorio, unpubl. data).

According to the records of prey items in literature and the obtained now, most of the insects mentioned by 

Hicks (
1959
)

in swallows’ nests can be consider as prey or as items delivered by adults to their nestlings and not eaten, but not as insects directly related to the birds (parasites) or to their nests (comensals, saprofages, hibernants): 

